import React from 'react';
import '../css/rentalworks.css';
import Rentvideo from '../media/rentalworks.mp4';

const Rentalworks = () => {

  return (
    <div >
      <video
        src={Rentvideo}
        muted
        autoPlay={"autoplay"}
        preLoad="auto"
        loop 
      ></video>
      <section>
        <h1></h1>
      </section>
    </div>
  )
}

export default Rentalworks
